import React from 'react';
import ProductCard from '../ProductCard/ProductCard';
import './ProductList.css';

const ProductList = () => {
  const products = [
    {
      id: 1,
      img: "./img/tovar/iphon12.jpg",
      model: "Смартфон Apple iPhone 14 128GB",
      oldPrice: 88888,
      newPrice: 84999,
      availability: true,
    },
    {
      id: 2,
      img: "./img/tovar/iphon12.jpg",
      model: "Смартфон Samsung Galaxy S23 256GB",
      oldPrice: 99999,
      newPrice: 88888,
      availability: false,
    }
  ];

  return (
    <div className="product-list-container">
      <h2 className="product-list-title">Каталог товаров</h2>
      <div className="product-list">
        {products.map((product) => (
          <ProductCard key={product.id} {...product} />
        ))}
      </div>
    </div>
  );
};

export default ProductList;
